This library provides an immutable data structure for javascript and datascience using `Array` and `TypedArray` with `ArrayBuffer` or `SharedArrayBuffer`, and which allows to work on rows and columns using functional programming.

## Examples of how to create Series
In the following, we use itemSize = 3 as an example.
### From an Array
```ts
const array = new Array(...)
const serie = Serie.create({array: array as IArray, itemSize: 3})
```

### From a TypedArray
```ts
const typedArray = new Float32Array(...)
const serie = Serie.create({array: typedArray as IArray, itemSize: 3})
```

### From a BufferAttribute (Three.js)
```ts
const bufferAttribute = new THREE.BufferAttribute(...)
const serie = Serie.create({array: bufferAttribute.array as IArray, itemSize: 3})
```

Using `createSerie` and `reduce`

```ts
import { Serie, createArray } from '@youwol/dataframe/utils'
import { reduce } from '@youwol/dataframe/algorithms'

const a   = Serie.create( { array: createArray(9, i=>i+1), itemSize: 3 })
const sol = reduce( a, v => v[0]+v[1]+v[2])
// sol.array = [6, 15, 24]
```

Using `createSerie`, `map` and `reduce`

```ts
import { createSerie, createArray } from '@youwol/dataframe/utils'
import { reduce } from '@youwol/dataframe/algorithms'

// Performs alpha[0]*S[0] + alpha[1]*S[1] + alpha[2]*S[2]
// i.e., sum_i{ alpha_i . S_i }

const alpha = [1, 2, 3]

const S = [
    Serie.create( {array: createArray(18, i => i  ), itemSize: 6})
    Serie.create( {array: createArray(18, i => i+1), itemSize: 6})
    Serie.create( {array: createArray(18, i => i+2), itemSize: 6})
]

const solution = reduce( S, (stresses) =>
    stresses
        .map( (s, i) => s.map( v => v*alpha[i] ) )
        .reduce( (acc, stress) => stress.map( (v,j) => v+acc[j] ), [0,0,0,0,0,0])
)

// solution.array = [
//    8, 14, 20, 26,  32,  38,
//   44, 50, 56, 62,  68,  74,
//   80, 86, 92, 98, 104, 110
// ]
```

The same example using math operations `add` and `mult`
```ts
import { Serie, createArray } from '@youwol/dataframe/utils'
import { add, mult } from '@youwol/dataframe/math'

const alpha = [1, 2, 3]

const S1 = Serie.create( {array: createArray(18, i => i  ), itemSize: 6})
const S2 = Serie.create( {array: createArray(18, i => i+1), itemSize: 6})
const S3 = Serie.create( {array: createArray(18, i => i+2), itemSize: 6})

const solution = add(
    mult( S1, alpha[0] ),
    mult( S2, alpha[1] ),
    mult( S3, alpha[2] )
)

// solution.array = [
//    8, 14, 20, 26,  32,  38,
//   44, 50, 56, 62,  68,  74,
//   80, 86, 92, 98, 104, 110
// ]
```

Using `createSerie` and `views`

```ts
import { Serie, createArray } from '@youwol/dataframe/utils'
import { reduce } from '@youwol/dataframe/algorithms'
import { matrix, vector } from '@youwol/dataframe/views'

const M = Serie.create( {array: createArray(27, i=>i), itemSize: 9}) // [0,1,2...17]
const V = Serie.create( {array: createArray(9 , i=>i), itemSize: 3}) // [0,1,2...8]

const reduced = reduce([M, V], ([m, v]) => {
    const A = matrix(m)
    const x = vector(v).normalize()
    return A.transpose().multVec(x)
})

// reduced.array = [
//    6.70820379257202,  8.04984474182128,  9.39148521423339,
//   21.21320343017578, 22.91025924682617, 24.60731506347656,
//   36.61966705322265, 38.34005355834961, 40.06044006347656
// ]
```

Iterating over multiple series at the same time
```ts
// 3 scalar series
const a1 = Serie.create( {array: [1, 2, 3], itemSize: 1})
const a2 = Serie.create( {array: [4, 5, 6], itemSize: 1})
const a3 = Serie.create( {array: [7, 8, 9], itemSize: 1})

// Generate a nes scalar serie
const a = reduce( [a1,a2,a3], ([s1, s2, s3]) => (s2-s3)/(s1-s3) )
```

Another example
```ts
import {Serie, reduce} from '@youwol/dataframe'
import {eifenValue}    from '@youwol/math'

const stress = Serie.create( {array: new Array(6*5).fill(0).map((v,i)=>i) , itemSize: 6})
const toto   = Serie.create( {array: new Array(5).fill(0).map((v,i)=>i**2), itemSize: 1})

// Generate a new scalar serie
const a = reduce( [eigenValue(stress), toto], ([eigen, value]) => {
    return (eigen[0]+eigen[1]±eigen[2])*value
})
```

A last one: compute the MCSS using a stress field
```ts
import {Serie, reduce} from '@youwol/dataframe'
import {eifenValue}    from '@youwol/math'

const stress = Serie.create( {array: new Array(6*5).fill(0).map((v,i)=>i) , itemSize: 6})

const mu = 0.6 // friction coefficient

// -------------------------------------------
// MCSS = (S1-S3)/2*sqrt(1+mu^2)-mu*(S1+S3)/2
// -------------------------------------------
const mu2 = Math.sqrt(1+mu**2)
const a = reduce( eigenValue(stress), eigen => mu2*(eigen[0]-eigen[2])/2 - mu*(eigen[0]+eigen[2])/2 )
```

Using DataFrame and others

```ts
import { DataFrame } from '@youwol/dataframe'
import { createEmptySeries, createSerie, createArray } from '@youwol/dataframe/utils'
import { trace, add, mult } from '@youwol/dataframe/math'

let df = new DataFrame({
    series: {
        a: createEmptySerie({ // length = 2*3
            Type     : Float32Array, 
            count    : 2, 
            itemSize : 3, 
            shared   : true
            }), 
        b: createEmptySerie({ // length = 2*3
            Type     : Float64Array, 
            count    : 2,
            itemSize : 3, 
            shared   : false
            }),
        c: Serie.create( {array: createArray(10, i => i), itemSize: 5}), // length = 10
        d: {
            serie: Serie.create({
                array: createArray(10, i => i),
                itemSize: 5,
                userData:{id:'tensor'}
            })
        }
    },
    userData: {
        id: 'dataframe-1'
    }
})

console.log( trace( df.get('c') ) )

console.log('add =', add(
    df.get('c'),
    100
))

console.log('mult =', mult(
    df.get('c'),
    100
))

// Performs a weighted sum of 2 series
const a = add(
    mult( df.get('a'), 0.1 ),
    mult( df.get('b'), 0.2 )
)
console.log(a)

df = append(df, {'d': a})
```
